// src/lib/pickSome.ts
var pickSome = (items, n) => {
  if (!items || !items.length) {
    throw Error("Invalid items");
  }
  const res = [];
  for (let i = 0; i < n; i++) {
    res.push(items[Math.floor(Math.random() * items.length)]);
  }
  return res;
};
var pickSome_default = pickSome;

export { pickSome_default };
